import React from 'react';
import axios from 'axios';
import './stats.css'


export default class Stats extends React.Component {
    constructor(props) {
        super(props);

        this.state = {
          requiredItem: 0,
          collectionOfstats: [],
          sessions: []
        }
      }
    componentDidMount() 
    {
        axios.get(`https://localhost:1337/sessions`)    
    }

    render(){
        console.log("Arriving here");
        return( <h1>This page will show stats of smart channel service</h1> )
    }
}
